    tl: "Max volume. Walang mga headphone. Para sa tumpak na pag -calibrate ng tunog, mangyaring i -maximize ang tunog ng tunog ng iyong computer ngayon, bago ang pag -calibrate, at pagkatapos ay huwag hawakan ang dami hanggang sa katapusan ng eksperimento.\nUser Camera upang makakuha ng QR Link. Kapag lumilitaw ang QR code sa ibaba, ituro ang iyong smartphone camera sa loob nito, at i -click ang link na lilitaw sa iyong smartphone screen. Pagkatapos ay sundin ang mga tagubilin sa screen ng smartphone.\nââââââââââââââââââââââââââââââââââââââââââââ\nTahimik po! Nagre -record na ngayon. Huwag hawakan ang kontrol ng dami.\nââââââââââââââââââââââââââââââââââââââââââââ\nSuliranin?\n1. Ang pangunahing web page na tumatakbo EasyEyes sa iyong laptop ay gumagamit ng WebRTC protocol upang makipag-usap sa webpage na naka-link sa QR sa iyong smartphone. Ang protocol na ito ay naghahanap ng pinakamahusay na maraming mga paraan upang kumonekta. Ang pinakamahusay ay kapag ang iyong telepono at computer ay pareho sa parehong network ng WiFi.\n                                                                                                                                 \n2. Kung ang iyong smartphone ay nag -uulat ng isang error sa koneksyon, subukang huminto at i -restart ang browser ng SMPartPhone, o kahit na i -restart ang SMPartPhone.\n                                                                                                                             \n3. Ito ay bihirang, ngunit, kung ang tunog ay hindi naglalaro, o, pagkatapos na maglaro, walang lilitaw na pindutan ng pagpapatuloy, nangangahulugan ito na nabigo ang pagkakalibrate. Maaari mong subukang muli sa pamamagitan ng pag -refresh ng pahina ng browser na ito. Na karaniwang ginagawa ang trick.",
