    nl: "MAXIMALE VOLUME. Geen koptelefoons. Voor nauwkeurige geluidskalibratie, maximaliseert u het geluidsvolume van uw computer nu, vÃ³Ã³r kalibratie, en raak het volume niet aan tot het einde van het experiment.\nGebruikerscamera om QR -link te krijgen. Wanneer de QR -code hieronder verschijnt, richt u uw smartphonecamera erop en klikt u op de link die op uw smartphonescherm verschijnt. Volg vervolgens de instructies op het smartphonescherm.\nââââââââââââââââââââââââââââââââââââââââââââ\nSTILTE ALSTUBLIEFT! Nu opnemen. Raak de volumeregeling niet aan.\nââââââââââââââââââââââââââââââââââââââââââââ\nPROBLEEM?\n1. De hoofdwebpagina met EasyEyes op uw laptop maakt gebruik van het WEBRTC-protocol om met de QR-gekoppelde webpagina op uw smartphone te praten. Dit protocol zoekt het beste van verschillende manieren om verbinding te maken. Het beste is wanneer uw telefoon en computer beide op hetzelfde wifi -netwerk staan.\n                                                                                                                                 \n2. Als uw smartphone een fout in de verbinding meldt, probeer dan de SMPartphone -browser te stoppen en opnieuw te starten of zelfs de SMPartphone opnieuw te starten.\n                                                                                                                             \n3. Het is zeldzaam, maar als het geluid niet speelt, of, nadat het speelt, er geen doorgaande knop verschijnt, betekent dit dat de kalibratie is mislukt. U kunt het opnieuw proberen door deze browserpagina te vernieuwen. Dat is meestal voldoende.",
    "en-UK":
      "MAX VOLUME. NO HEADPHONES. For accurate sound calibration, please maximize your computer's sound volume now, before calibration, and then don't touch the volume until the end of the experiment.\nUSER CAMERA TO GET QR LINK. When the QR code appears below, point your smartphone camera at it, and click the link that appears on your smartphone screen. Then follow the instructions on the smartphone screen.\nââââââââââââââââââââââââââââââââââââââââââ\nQUIET PLEASE! NOW RECORDING. DO NOT TOUCH THE VOLUME CONTROL.\nââââââââââââââââââââââââââââââââââââââââââ\nPROBLEM?                                                                                                                                 \n1. The main web page running EasyEyes on your laptop uses the webRTC protocol to talk to the QR-linked webpage on your smartphone. This protocol seeks out the best of several ways to connect. The best is when your phone and computer are both on the same WiFi network.\n                                                                                                                                 \n2. If your smartphone reports an error in the connection, try quitting and restarting the smpartphone browser, or even restarting the smpartphone.\n                                                                                                                             \n3. It's rare, but, if the sound doesn't play, or, after it plays, no Proceed button appears, it means the calibration failed. You can try again by refreshing this browser page. That usually does the trick.",
