    id: "Volume maksimal. Tidak ada headphone. Untuk kalibrasi suara yang akurat, silakan memaksimalkan volume suara komputer Anda sekarang, sebelum kalibrasi, dan kemudian jangan menyentuh volume sampai akhir percobaan.\nKamera Pengguna untuk mendapatkan tautan QR. Ketika kode QR muncul di bawah, arahkan kamera ponsel cerdas Anda ke sana, dan klik tautan yang muncul di layar ponsel cerdas Anda. Kemudian ikuti instruksi di layar ponsel cerdas.\nâââââââââââââââââââââââââââââââââââââââââââââ-\nHARAP TENANG! Sekarang merekam. Jangan menyentuh kontrol volume.\nâââââââââââââââââââââââââââââââââââââââââââââ-\nMASALAH?\n1. Halaman web utama yang menjalankan EyyEyes di laptop Anda menggunakan protokol WEBRTC untuk berbicara dengan halaman web yang terkait dengan QR di ponsel cerdas Anda. Protokol ini mencari yang terbaik dari beberapa cara untuk terhubung. Yang terbaik adalah saat ponsel dan komputer Anda berada di jaringan WiFi yang sama.\n                                                                                                                                 \n2. Jika ponsel cerdas Anda melaporkan kesalahan dalam koneksi, cobalah berhenti dan mulai ulang browser SMPartphone, atau bahkan memulai kembali SMPartphone.\n                                                                                                                             \n3. Ini jarang, tetapi, jika suaranya tidak diputar, atau, setelah diputar, tidak ada tombol proses yang muncul, itu berarti kalibrasi gagal. Anda dapat mencoba lagi dengan menyegarkan halaman browser ini. Itu biasanya triknya.",
    it: "VOLUME MASSIMO. Nessuna cuffia. Per una calibrazione del suono accurata, massimizza ora il volume del suono del computer, prima della calibrazione, quindi non toccare il volume fino alla fine dell'esperimento.\nFotocamera utente per ottenere il collegamento QR. Quando il codice QR viene visualizzato di seguito, punta la fotocamera per smartphone e fai clic sul collegamento che appare sullo schermo dello smartphone. Quindi seguire le istruzioni sullo schermo dello smartphone.\nââââââââââââââââââââââââââââââââââââââââââââââ\nSILENZIO PREGO! Ora registrazione. Non toccare il controllo del volume.\nââââââââââââââââââââââââââââââââââââââââââââââ\nPROBLEMA?\n1. La pagina Web principale che esegue EasyEyes sul tuo laptop utilizza il protocollo WebRTC per parlare con la pagina Web legata al QR sul tuo smartphone. Questo protocollo cerca il meglio di diversi modi per connettersi. Il meglio Ã¨ quando il telefono e il computer sono entrambi sulla stessa rete WiFi.\n                                                                                                                                 \n2. Se il tuo smartphone segnala un errore nella connessione, prova a smettere e riavviare il browser SMPARTphone o addirittura riavviare SMPARTphone.\n                                                                                                                             \n3. Ã raro, ma, se il suono non suona o, dopo che riproduce, non appare il pulsante di procedimento, significa che la calibrazione non Ã¨ riuscita. Puoi riprovare aggiornando questa pagina del browser. Questo di solito fa il trucco.",
