    ms: "Volum maks. Tiada fon kepala. Untuk penentukuran bunyi yang tepat, sila memaksimumkan kelantangan bunyi komputer anda sekarang, sebelum penentukuran, dan kemudian jangan sentuh kelantangan sehingga akhir eksperimen.\nKamera pengguna untuk mendapatkan pautan QR. Apabila kod QR muncul di bawah, arahkan kamera telefon pintar anda, dan klik pautan yang muncul pada skrin telefon pintar anda. Kemudian ikuti arahan pada skrin telefon pintar.\nâââââââââââââââââââââââââââââââââââââââââ-\nTOLONG SENYAP! Sekarang rakaman. Jangan sentuh kawalan kelantangan.\nâââââââââââââââââââââââââââââââââââââââââ-\nMasalah?\n1. Laman web utama yang menjalankan EasyEyes pada komputer riba anda menggunakan protokol WebRTC untuk bercakap dengan laman web yang berkaitan dengan QR pada telefon pintar anda. Protokol ini mencari yang terbaik dari beberapa cara untuk menyambung. Yang terbaik adalah apabila telefon dan komputer anda berada di rangkaian WiFi yang sama.\n                                                                                                                                 \n2. Jika telefon pintar anda melaporkan ralat dalam sambungan, cuba berhenti dan mulakan semula pelayar SMPartphone, atau mulakan semula SMPartphone.\n                                                                                                                             \n3. Ia jarang berlaku, tetapi, jika bunyi tidak bermain, atau, selepas ia bermain, tiada butang teruskan muncul, itu bermakna penentukuran gagal. Anda boleh mencuba lagi dengan menyegarkan halaman penyemak imbas ini. Itu biasanya melakukan silap mata.",
