    tl: "Paliwanag. Para sa hakbang na ito, lumapit, kung kinakailangan, kaya hindi ka mas malayo kaysa sa dalawang beses sa lapad ng screen. Ang bawat mata ay may blindspot. Hahanapin namin ang iyong upang matuklasan kung gaano kalayo ang iyong mata mula sa screen. Hihilingin kang isara o takpan ang isang mata upang ihiwalay ang isa. Habang nakatuon ka sa mga hair hair, panoorin ang kumikislap na tuldok sa sulok ng iyong mata, at pindutin ang pagbabalik kapag nawala ito sa iyong blindspot. Depende sa pagtingin sa distansya at laki ng screen, ang kumikislap na tuldok ay karaniwang maaabot ang iyong blindspot bago ito makarating sa gitna ng screen. Gagawin mo ito sa bawat mata, alternating, hanggang sa huling dalawang sukat ay pare -pareho. Mangyaring panatilihin ang iyong distansya sa pagtingin habang sinusubukan mo ang parehong mga mata. Tandaan. Kung ang tuldok ay hindi kailanman mawawala, nangangahulugan ito na ang iyong mata ay sumusunod sa tuldok, sa halip na manatili sa mga cross hairs. Ang pagsubok na ito ay nangangailangan sa iyo upang panatilihin ang iyong mata sa mga hair hair habang sinusubaybayan ang kumikislap na tuldok sa sulok ng iyong mata. Iyon ay mahirap sa una, ngunit nagiging mas madali sa pagsasanay.",
