    da: "FORKLARING. Til dette trin skal du om nÃ¸dvendigt komme nÃ¦rmere, sÃ¥ du er ikke lÃ¦ngere end det dobbelte af skÃ¦rmbredden. Hvert Ã¸je har et blindspot. Vi finder din til at opdage, hvor langt dit Ã¸je er fra skÃ¦rmen. Du bliver bedt om at lukke eller dÃ¦kke det ene Ã¸je for at isolere det andet. Mens du fokuserer pÃ¥ krydshÃ¥rene, skal du se den flimrende prik ud af hjÃ¸rnet af dit Ã¸je og ramme retur, nÃ¥r det forsvinder i dit blindspot. AfhÃ¦ngig af visningsafstand og skÃ¦rmstÃ¸rrelse vil den flimrende dot typisk nÃ¥ din blindspot, fÃ¸r det kommer til midten af ââskÃ¦rmen. Du vil gÃ¸re dette med hvert Ã¸je, skiftevis, indtil de to sidste mÃ¥linger er konsistente. Vedligehold din visningsafstand, nÃ¥r du tester begge Ã¸jne. BEMÃRK. Hvis prikken aldrig forsvinder, betyder det, at dit Ã¸je fÃ¸lger prikken, i stedet for at blive pÃ¥ krydshÃ¥rene. Denne test har brug for dig for at holde Ã¸je med tvÃ¦rhÃ¥rene, mens du overvÃ¥ger den flimrende prik i hjÃ¸rnet af dit Ã¸je. Det er svÃ¦rt i starten, men bliver lettere med praksis.",
    nl: "UITLEG. Kom voor deze stap dichterbij, indien nodig, dus je bent niet verder dan twee keer de schermbreedte. Elk oog heeft een blindspot. We zullen de jouwe vinden om te ontdekken hoe ver je oog van het scherm is. U wordt gevraagd om het ene oog te sluiten of te bedekken om het andere te isoleren. Terwijl je je concentreert op de kruisharen, kijk je naar de flikkerende stip uit de hoek van je oog en raak je terug wanneer deze in je blinde spot verdwijnt. Afhankelijk van de kijkafstand en de schermgrootte, zal de flikkerende stip meestal uw blindspot bereiken voordat deze in het midden van het scherm komt. Je zult dit met elk oog doen, afwisselend, totdat de laatste twee metingen consistent zijn. Handhaaf uw kijkafstand terwijl u beide ogen test. OPMERKING. Als de stip nooit verdwijnt, betekent dit dat je oog de stip volgt, in plaats van op de kruisharen te blijven. Deze test moet u in de gaten houden op de kruisharen terwijl u de flikkerende stip in de hoek van uw oog bewaakt. Dat is in het begin moeilijk, maar wordt gemakkelijker met de praktijk.",
    "en-UK":
      "EXPLANATION. For this step, come closer, if necessary, so you're no farther than twice the screen width. Every eye has a blindspot. We'll find yours to discover how far your eye is from the screen. You'll be asked to close or cover one eye to isolate the other. While you focus on the cross hairs, watch the flickering dot out of the corner of your eye, and hit RETURN when it disappears into your blindspot. Depending on viewing distance and screen size, the flickering dot typically will reach your blindspot before it gets to the middle of the screen. You'll do this with each eye, alternating, until the last two measurements are consistent. Please maintain your viewing distance as you test both eyes. NOTE. If the dot never disappears, it means that your eye is following the dot, instead of staying on the cross hairs. This test needs you to keep your eye on the cross hairs while monitoring the flickering dot in the corner of your eye. That's hard at first, but becomes easier with practice.",
    "en-US_1":
      "EXPLANATION. For this step, come closer, if necessary, so you're no farther than twice the screen width. Every eye has a blindspot. We'll find yours to discover how far your eye is from the screen. You'll be asked to close or cover one eye to isolate the other. While you focus on the cross hairs, watch the flickering dot out of the corner of your eye, and hit RETURN when it disappears into your blindspot. Depending on viewing distance and screen size, the flickering dot typically will reach your blindspot before it gets to the middle of the screen. You'll do this with each eye, alternating, until the last two measurements are consistent. Please maintain your viewing distance as you test both eyes. NOTE. If the dot never disappears, it means that your eye is following the dot, instead of staying on the cross hairs. This test needs you to keep your eye on the cross hairs while monitoring the flickering dot in the corner of your eye. That's hard at first, but becomes easier with practice.",
