    fr: "EXPLICATION. Pour cette Ã©tape, rapprochez-vous, si nÃ©cessaire, vous n'Ãªtes donc pas plus loin que deux fois la largeur de l'Ã©cran. Chaque Åil a un point mort. Nous trouverons le vÃ´tre pour dÃ©couvrir Ã  quel point votre Åil est de l'Ã©cran. On vous demandera de fermer ou de couvrir un Åil pour isoler l'autre. Pendant que vous vous concentrez sur les cheveux, regardez le point scintillant du coin de votre Åil et appuyez sur votre retour lorsqu'il disparaÃ®t dans votre point mort. Selon la distance de visualisation et la taille de l'Ã©cran, le point scintillant atteindra gÃ©nÃ©ralement votre point mort avant qu'il n'atteigne au milieu de l'Ã©cran. Vous le ferez avec chaque Åil, en alternant, jusqu'Ã  ce que les deux derniÃ¨res mesures soient cohÃ©rentes. Veuillez maintenir votre distance de visualisation lorsque vous testez les deux yeux. NOTE. Si le point ne disparaÃ®t jamais, cela signifie que votre Åil suit le point, au lieu de rester sur les poils. Ce test a besoin de vous pour garder un Åil sur les cheveux en surveillant le point vacillant dans le coin de votre Åil. C'est difficile au dÃ©but, mais devient plus facile avec la pratique.",
    de: "ERLÃUTERUNG. Bei diesem Schritt kommen Sie bei Bedarf nÃ¤her, damit Sie nicht weiter als doppelt so hoch wie die Bildschirmbreite sind. Jedes Auge hat einen Blindspot. Wir werden Ihre finden, um herauszufinden, wie weit Ihr Auge vom Bildschirm entfernt ist. Sie werden gebeten, ein Auge zu schlieÃen oder abzudecken, um das andere zu isolieren. WÃ¤hrend Sie sich auf die Kreuzhaare konzentrieren, beobachten Sie den flackernden Punkt aus dem Augenwinkel und treffen Sie die RÃ¼ckkehr, wenn er in Ihrem Blindspot verschwindet. AbhÃ¤ngig von der Betrachtung der Entfernung und der BildschirmgrÃ¶Ãe erreicht der flackernde Punkt normalerweise Ihren Blindspot, bevor er in die Mitte des Bildschirms gelangt. Sie werden dies mit jedem Auge wechseln, bis die letzten beiden Messungen konsistent sind. Bitte behalten Sie Ihren Betrachtungsabstand bei, wÃ¤hrend Sie beide Augen testen. NOTIZ. Wenn der Punkt nie verschwindet, bedeutet dies, dass Ihr Auge dem Punkt folgt, anstatt auf den Kreuzhaaren zu bleiben. In diesem Test mÃ¼ssen Sie die Kreuzhaare im Auge behalten und gleichzeitig den flackernden Punkt in Ihrem Augenwinkel Ã¼berwachen. Das ist zunÃ¤chst schwierig, wird aber beim Ãben einfacher.",
