    id: "PENJELASAN. Untuk langkah ini, lebih dekat, jika perlu, jadi Anda tidak lebih dari dua kali lebar layar. Setiap mata memiliki blindspot. Kami akan menemukan milik Anda untuk menemukan seberapa jauh mata Anda dari layar. Anda akan diminta untuk menutup atau menutupi satu mata untuk mengisolasi yang lain. Saat Anda fokus pada rambut salib, saksikan titik -titik yang berkedip -kedip dari sudut mata Anda, dan tekan kembali saat menghilang ke dalam blindspot Anda. Bergantung pada jarak menonton dan ukuran layar, titik -titik yang berkedip -kedip biasanya akan mencapai titik blindspot Anda sebelum sampai di tengah layar. Anda akan melakukan ini dengan masing -masing mata, bergantian, sampai dua pengukuran terakhir konsisten. Harap pertahankan jarak menonton Anda saat Anda menguji kedua mata. CATATAN. Jika titik tidak pernah menghilang, itu berarti mata Anda mengikuti titik, alih -alih tetap di rambut salib. Tes ini membutuhkan Anda untuk mengawasi rambut silang sambil memantau titik -titik yang berkedip -kedip di sudut mata Anda. Itu sulit pada awalnya, tetapi menjadi lebih mudah dengan latihan.",
    it: "SPIEGAZIONE. Per questo passaggio, avvicinati, se necessario, quindi non sei piÃ¹ lontano del doppio della larghezza dello schermo. Ogni occhio ha un cieco. Troveremo il tuo per scoprire quanto Ã¨ lontano il tuo occhio dallo schermo. Ti verrÃ  chiesto di chiudere o coprire un occhio per isolare l'altro. Mentre ti concentri sui capelli incrociati, guarda il punto tremolante dall'angolo dell'occhio e colpisci ritorna quando scompare nel tuo cieco. A seconda della distanza di visualizzazione e dello schermo, il punto tremolante in genere raggiungerÃ  il tuo cieco prima che arrivi al centro dello schermo. Lo farai con ogni occhio, alternando, fino a quando le ultime due misurazioni sono coerenti. Si prega di mantenere la distanza di visualizzazione mentre si verificano entrambi gli occhi. NOTA. Se il punto non scompare mai, significa che il tuo occhio sta seguendo il punto, invece di rimanere sui capelli incrociati. Questo test ha bisogno di te per tenere d'occhio i peli incrociati mentre monitori il punto tremolo nell'angolo dell'occhio. All'inizio Ã¨ difficile, ma diventa piÃ¹ facile con la pratica.",
