    ms: "Penjelasan. Untuk langkah ini, lebih dekat, jika perlu, jadi anda tidak lebih jauh daripada dua kali lebar skrin. Setiap mata mempunyai tiringan. Kami akan menemui anda untuk mengetahui sejauh mana mata anda dari skrin. Anda akan diminta menutup atau menutup satu mata untuk mengasingkan yang lain. Semasa anda memberi tumpuan kepada rambut salib, tonton titik berkedip dari sudut mata anda, dan tekan kembali apabila ia hilang ke dalam Blindspot anda. Bergantung pada jarak tontonan dan saiz skrin, titik berkedip biasanya akan sampai ke tirim anda sebelum sampai ke tengah -tengah skrin. Anda akan melakukan ini dengan setiap mata, berselang -seli, sehingga dua pengukuran terakhir adalah konsisten. Sila jaga jarak tontonan anda semasa anda menguji kedua -dua mata. CATATAN. Jika titik tidak pernah hilang, ini bermakna mata anda mengikuti titik, bukannya tinggal di rambut salib. Ujian ini memerlukan anda untuk mengawasi rambut salib sambil memantau titik berkedip di sudut mata anda. Itu sukar pada mulanya, tetapi menjadi lebih mudah dengan amalan.",
