    pt: "EXPLICAÃÃO. Para esta etapa, chegue mais perto, se necessÃ¡rio, para que vocÃª nÃ£o esteja mais longe do que o dobro da largura da tela. Todo olho tem um ponto cego. Vamos encontrar o seu para descobrir atÃ© que ponto seus olhos estÃ£o da tela. VocÃª serÃ¡ solicitado a fechar ou cobrir um olho para isolar o outro. Enquanto vocÃª se concentra nos cabelos cruzados, observe o ponto tremeluzente pelo canto do olho e acerte o retorno quando ele desaparecer no seu ponto cego. Dependendo da distÃ¢ncia de visualizaÃ§Ã£o e do tamanho da tela, o ponto de tremeling normalmente atinge seu ponto cego antes de chegar ao meio da tela. VocÃª farÃ¡ isso a cada olho, alternando, atÃ© que as duas Ãºltimas mediÃ§Ãµes sejam consistentes. Por favor, mantenha sua distÃ¢ncia de visualizaÃ§Ã£o enquanto vocÃª testa os dois olhos. OBSERVAÃÃO. Se o ponto nunca desaparece, significa que seu olho estÃ¡ seguindo o ponto, em vez de ficar nos cabelos cruzados. Este teste precisa que vocÃª fique de olho nos cabelos cruzados enquanto monitorava o ponto tremeluzente no canto do olho. Isso Ã© difÃ­cil no comeÃ§o, mas se torna mais fÃ¡cil com a prÃ¡tica.",
