    es: "EXPLICACIÃN. Para este paso, acÃ©rcate, si es necesario, por lo que no estÃ¡s mÃ¡s lejos del doble del ancho de la pantalla. Cada ojo tiene un punto ciego. Encontraremos el suyo para descubrir quÃ© tan lejos estÃ¡ su ojo desde la pantalla. Se le pedirÃ¡ que cierre o cubra un ojo para aislar al otro. Mientras te enfocas en la cruz, mira el punto parpadeante en la esquina del ojo y presione el retorno cuando desaparezca en tu punto ciego. Dependiendo de la distancia de visualizaciÃ³n y el tamaÃ±o de la pantalla, el punto parpadeante generalmente alcanzarÃ¡ su punto ciego antes de que llegue al centro de la pantalla. HarÃ¡ esto con cada ojo, alternando, hasta que las dos Ãºltimas medidas sean consistentes. Mantenga su distancia de visiÃ³n mientras prueba ambos ojos. NOTA. Si el punto nunca desaparece, significa que su ojo estÃ¡ siguiendo el punto, en lugar de permanecer en la cruz. Esta prueba necesita que mantenga su ojo en la cruz mientras monitorea el punto parpadeante en la esquina de su ojo. Eso es difÃ­cil al principio, pero se vuelve mÃ¡s fÃ¡cil con la prÃ¡ctica.",
    su: "Panjelasan Pikeun lÃ©ngkah ieu, datang langkung caket, upami diperyogikeun, Jadi anjeun teu langkung tebih tibatan dua kali lebar layar. Unggal panon gaduh buta. Kami bakal mendakan anjeun pikeun mendakan sabaraha panon anjeun tina layar. Anjeun bakal dipenta pikeun nutup atanapi nutupan hiji panon pikeun ngasingkeun anu sanÃ©s. Sanaos anjeun difokuskeun rambut salib, nonton dat clickering dating kaluar ti juru panon anjeun, sareng pencÃ©t uih nalika ngaleungit kana buta anjeun. Gumantung kana jarak jarak sareng layar, titik-layar anu flickering biasana bakal ngahontal blackpot sateuacan Ã©ta janten tengah layar. Anjeun bakal ngalakukeun ku unggal unggal panon, batat, dugi ka dua Ukuran terakhir sacara konsisten. Punten ngajaga jarak pandangan anjeun nalika nguji kadua panon. CATETAN. Upami titik teu sirna, Ã©ta hartosna nyababkeun panon anjeun di handap dot, tibatan tinggal dina rambut salib. TÃ©s ieu peryogi anjeun tetep panon anjeun dina rambut salib bari ngawaskeun titik pÃ©ngkolan di pojok panon anjeun. Ãta hÃ©sÃ© mimitina, tapi janten langkung gampang sareng praktÃ©k.",
    sw: "Maelezo. Kwa hatua hii, njoo karibu, ikiwa ni lazima, kwa hivyo sio mbali zaidi kuliko upana wa skrini mara mbili. Kila jicho lina blindspot. Tutapata yako kugundua ni umbali gani kutoka kwa skrini. Utaulizwa kufunga au kufunika jicho moja ili kutenga nyingine. Wakati unazingatia nywele za msalaba, angalia dot inayozunguka nje ya kona ya jicho lako, na piga kurudi wakati unapotea ndani ya blindspot yako. Kulingana na umbali wa kutazama na saizi ya skrini, dot inayozunguka kawaida itafikia blindspot yako kabla ya kufika katikati ya skrini. Utafanya hivyo kwa kila jicho, kubadilisha, hadi vipimo viwili vya mwisho vimebadilika. Tafadhali endelea umbali wako wa kutazama unapojaribu macho yote mawili. KUMBUKA. Ikiwa dot haitoweka kamwe, inamaanisha kuwa jicho lako linafuata dot, badala ya kukaa kwenye nywele za msalaba. Mtihani huu unahitaji wewe kuweka jicho lako kwenye nywele za msalaba wakati unafuatilia dot inayozunguka kwenye kona ya jicho lako. Hiyo ni ngumu mwanzoni, lakini inakuwa rahisi na mazoezi.",
