      "SOUND DETECTION. You're about to start a block of many trials. You're trying to detect a particular target sound: one note, repeated 8 times, always the same note. That target is only present on half the trials, randomly. On each trial, your job is to listen and decide whether it was present, yes or no. As you progress from trial to trial, based on your responses, the target sound volume will adapt so that it's barely detectable. In the initial practice block, the target will be alone. In later blocks, the target will be harder to detect because of other sounds. Always ignore the other sounds, and try to report, yes or no, whether the target sound was present. Use the \"y\" key for yes and the \"n\" key for no. \n\nHit RETURN or click PROCEED as soon as you're ready. The PROCEED button will disappear immediately, and the experiment will begin once the sounds are loaded, which takes 40 seconds or longer, depending on the speed of the internet connection. We are working to shorten this delay in a future release.\n\nLoading sounds ...",
    af: 'Klankopsporing. U is op die punt om \'n blok van baie proewe te begin. U probeer \'n spesifieke teikenklank opspoor: een noot, 8 keer herhaal, altyd dieselfde noot. Die teiken is slegs lukraak op die helfte van die proewe. By elke verhoor is u taak om te luister en te besluit of dit teenwoordig was, ja of nee. Namate u van verhoor tot verhoor vorder, op grond van u antwoorde, sal die teikenklankvolume aanpas sodat dit skaars waarneembaar is. In die aanvanklike praktykblok sal die teiken alleen wees. In latere blokke sal die teiken moeiliker wees om op te spoor as gevolg van ander klanke. Ignoreer altyd die ander geluide en probeer om aan te meld, ja of nee, of die teikenklank teenwoordig was. Gebruik die "Y" -toets vir Ja en die "N" -toets vir no.\n\nKlik op Return of klik Sodra u gereed is. Die voortplantingsknoppie sal onmiddellik verdwyn, en die eksperiment sal begin sodra die geluide gelaai is, wat 40 sekondes of langer duur, afhangende van die snelheid van die internetverbinding. Ons werk om hierdie vertraging in \'n toekomstige vrylating te verkort.\n\nLaai klanke ...',
