    tl: 'Tunog ng tunog. Malapit na magsisimula ka ng isang bloke ng maraming mga pagsubok. Sinusubukan mong makita ang isang partikular na target na tunog: isang tala, paulit -ulit na 8 beses, palaging pareho ang tala. Ang target na iyon ay naroroon lamang sa kalahati ng mga pagsubok, nang sapalaran. Sa bawat pagsubok, ang iyong trabaho ay upang makinig at magpasya kung naroroon ito, oo o hindi. Habang sumusulong ka mula sa pagsubok hanggang sa pagsubok, batay sa iyong mga tugon, ang target na tunog ng tunog ay umangkop upang halos hindi ito makita. Sa paunang block block, mag -isa ang target. Sa paglaon ng mga bloke, ang target ay magiging mas mahirap makita dahil sa iba pang mga tunog. Laging huwag pansinin ang iba pang mga tunog, at subukang mag -ulat, oo o hindi, kung ang target na tunog ay naroroon. Gamitin ang "Y" key para sa oo at ang "n" key para sa hindi.\n\nHit return o i -click ang magpatuloy sa sandaling handa ka na. Ang pindutan ng pagpapatuloy ay mawawala kaagad, at ang eksperimento ay magsisimula sa sandaling mai -load ang mga tunog, na tumatagal ng 40 segundo o mas mahaba, depende sa bilis ng koneksyon sa internet. Nagtatrabaho kami upang paikliin ang pagkaantala na ito sa isang paglabas sa hinaharap.\n\nNaglo -load ng tunog ...',
