    da: 'Lyddetektion. Du er ved at starte en blok af mange forsÃ¸g. Du prÃ¸ver at registrere en bestemt mÃ¥llyd: en note, gentaget 8 gange, altid den samme note. Dette mÃ¥l er kun til stede pÃ¥ halvdelen af ââforsÃ¸gene tilfÃ¦ldigt. PÃ¥ hver prÃ¸ve er dit job at lytte og beslutte, om det var til stede, ja eller nej. NÃ¥r du skrider frem fra prÃ¸ve til prÃ¸ve, baseret pÃ¥ dine svar, vil mÃ¥llydvolumen tilpasse sig, sÃ¥ det nÃ¦ppe kan pÃ¥vises. I den indledende praksisblok vil mÃ¥let vÃ¦re alene. I senere blokke vil mÃ¥let vÃ¦re svÃ¦rere at opdage pÃ¥ grund af andre lyde. Ignorer altid de andre lyde, og prÃ¸v at rapportere, ja eller nej, om mÃ¥llyden var til stede. Brug "Y" -tasten til Ja og "N" -tasten til nr.\n\nHit retur eller klik, fortsÃ¦t, sÃ¥ snart du er klar. FortsÃ¦tknappen forsvinder straks, og eksperimentet begynder, nÃ¥r lyden er indlÃ¦st, hvilket tager 40 sekunder eller lÃ¦ngere, afhÃ¦ngigt af hastigheden pÃ¥ internetforbindelsen. Vi arbejder pÃ¥ at forkorte denne forsinkelse i en fremtidig udgivelse.\n\nIndlÃ¦ser lyde ...',
    nl: 'Geluidsdetectie. Je staat op het punt een blok van veel proeven te beginnen. U probeert een bepaald doelgeluid te detecteren: Ã©Ã©n noot, 8 keer herhaald, altijd dezelfde noot. Dat doelwit is alleen willekeurig aanwezig op de helft van de proeven, willekeurig. Bij elke proef is het je taak om te luisteren en te beslissen of het aanwezig was, ja of nee. Naarmate u verder gaat van proef naar proef, zal het doelvolume op basis van uw antwoorden zich aanpassen zodat het nauwelijks detecteerbaar is. In het eerste oefenblok zal het doel alleen zijn. In latere blokken zal het doelwit moeilijker te detecteren zijn vanwege andere geluiden. Negeer altijd de andere geluiden en probeer te melden, ja of nee, of het doelgeluid aanwezig was. Gebruik de "Y" -toets voor ja en de "N" -toets voor nee.\n\nDruk op Return of klik op verder zodra u klaar bent. De knop Voortgang zal onmiddellijk verdwijnen en het experiment begint zodra de geluiden zijn geladen, die 40 seconden of langer duurt, afhankelijk van de snelheid van de internetverbinding. We werken om deze vertraging in een toekomstige release te verkorten.\n\nGeluiden laden ...',
    "en-UK":
      "SOUND DETECTION. You're about to start a block of many trials. You're trying to detect a particular target sound: one note, repeated 8 times, always the same note. That target is only present on half the trials, randomly. On each trial, your job is to listen and decide whether it was present, yes or no. As you progress from trial to trial, based on your responses, the target sound volume will adapt so that it's barely detectable. In the initial practice block, the target will be alone. In later blocks, the target will be harder to detect because of other sounds. Always ignore the other sounds, and try to report, yes or no, whether the target sound was present. Use the \"y\" key for yes and the \"n\" key for no. \n\nHit RETURN or click PROCEED as soon as you're ready. The PROCEED button will disappear immediately, and the experiment will begin once the sounds are loaded, which takes 40 seconds or longer, depending on the speed of the internet connection. We are working to shorten this delay in a future release.\n\nLoading sounds ...",
    "en-US_1":
      "SOUND DETECTION. You're about to start a block of many trials. You're trying to detect a particular target sound: one note, repeated 8 times, always the same note. That target is only present on half the trials, randomly. On each trial, your job is to listen and decide whether it was present, yes or no. As you progress from trial to trial, based on your responses, the target sound volume will adapt so that it's barely detectable. In the initial practice block, the target will be alone. In later blocks, the target will be harder to detect because of other sounds. Always ignore the other sounds, and try to report, yes or no, whether the target sound was present. Use the \"y\" key for yes and the \"n\" key for no. \n\nHit RETURN or click PROCEED as soon as you're ready. The PROCEED button will disappear immediately, and the experiment will begin once the sounds are loaded, which takes 40 seconds or longer, depending on the speed of the internet connection. We are working to shorten this delay in a future release.\n\nLoading sounds ...",
