    id: 'Deteksi suara. Anda akan memulai satu blok dari banyak uji coba. Anda mencoba mendeteksi suara target tertentu: satu catatan, diulangi 8 kali, selalu nada yang sama. Target itu hanya hadir pada setengah uji coba, secara acak. Pada setiap percobaan, pekerjaan Anda adalah mendengarkan dan memutuskan apakah itu ada, ya atau tidak. Saat Anda maju dari percobaan ke percobaan, berdasarkan tanggapan Anda, volume suara target akan beradaptasi sehingga hampir tidak terdeteksi. Di blok latihan awal, target akan sendirian. Di blok selanjutnya, target akan lebih sulit dideteksi karena suara lainnya. Selalu abaikan suara lainnya, dan coba laporkan, ya atau tidak, apakah suara target ada. Gunakan tombol "y" untuk Ya dan tombol "n" untuk tidak.\n\nTekan kembali atau klik lanjutkan segera setelah Anda siap. Tombol Prosed akan segera hilang, dan percobaan akan dimulai setelah suara dimuat, yang membutuhkan waktu 40 detik atau lebih, tergantung pada kecepatan koneksi internet. Kami berupaya mempersingkat penundaan ini dalam rilis di masa mendatang.\n\nMemuat suara ...',
    it: 'Rilevamento del suono. Stai per iniziare un blocco di molte prove. Stai cercando di rilevare un particolare suono di destinazione: una nota, ripetuta 8 volte, sempre la stessa nota. Tale obiettivo Ã¨ presente solo a metÃ  degli studi, in modo casuale. Ad ogni prova, il tuo compito Ã¨ ascoltare e decidere se era presente, sÃ¬ o no. Man mano che avanzi da processo a prova, in base alle tue risposte, il volume del suono target si adatterÃ  in modo che sia appena rilevabile. Nel blocco di pratica iniziale, l\'obiettivo sarÃ  solo. Nei blocchi successivi, l\'obiettivo sarÃ  piÃ¹ difficile da rilevare a causa di altri suoni. Ignora sempre gli altri suoni e prova a segnalare, sÃ¬ o no, se il suono target era presente. Usa il tasto "Y" per sÃ¬ e il tasto "N" per il no.\n\nPremi reso o fai clic su Procedi non appena sei pronto. Il pulsante di procedimento scomparirÃ  immediatamente e l\'esperimento inizierÃ  una volta caricati i suoni, il che richiede 40 secondi o piÃ¹, a seconda della velocitÃ  della connessione Internet. Stiamo lavorando per abbreviare questo ritardo in una versione futura.\n\nCaricamento dei suoni ...',
