    lt: "Garso aptikimas. JÅ«s ketinate pradÄti daugelio bandymÅ³ blokÄ. JÅ«s bandote aptikti tam tikrÄ tikslinÄ¯ garsÄ: viena pastaba, pakartota 8 kartus, visada ta pati pastaba. Å is tikslas yra tik pusÄje bandymÅ³ atsitiktinai. Kiekvieno tyrimo metu jÅ«sÅ³ darbas yra klausytis ir nusprÄsti, ar jis buvo, taip, ar ne. Remdamiesi jÅ«sÅ³ atsakymais, pereinant nuo bandymo iki bandymo, tikslinio garso tÅ«ris prisitaikys taip, kad jis vos aptinkamas. Pradiniame praktikos bloke taikinys bus vienas. VÄlesniuose blokuose taikinÄ¯ bus sunkiau nustatyti dÄl kitÅ³ garsÅ³. Visada nekreipkite dÄmesio Ä¯ kitus garsus ir pabandykite praneÅ¡ti: taip, ar ne, ar buvo tikslinis garsas. Naudokite âYâ klaviÅ¡Ä âYâ ir âNâ klaviÅ¡Ä.\n\nPaspauskite grÄÅ¾inimÄ arba spustelÄkite Vykdykite, kai tik bÅ«site pasiruoÅ¡Ä. Atlikimo mygtukas nedelsdamas iÅ¡nyks, o eksperimentas prasidÄs, kai garsai bus Ä¯kelti, o tai uÅ¾truks 40 sekundÅ¾iÅ³ ar ilgiau, atsiÅ¾velgiant Ä¯ interneto ryÅ¡io greitÄ¯. Mes stengiamÄs sutrumpinti Å¡Ä¯ vÄlavimÄ ateityje.\n\nÄ®keliami garsai ...",
    ms: 'Pengesanan bunyi. Anda akan memulakan blok banyak ujian. Anda cuba mengesan bunyi sasaran tertentu: satu nota, berulang 8 kali, selalu nota yang sama. Sasaran itu hanya terdapat pada separuh percubaan, secara rawak. Pada setiap percubaan, tugas anda adalah untuk mendengar dan memutuskan sama ada ia hadir, ya atau tidak. Semasa anda maju dari percubaan ke percubaan, berdasarkan respons anda, jumlah sasaran bunyi akan menyesuaikan diri supaya ia hampir tidak dapat dikesan. Dalam blok amalan awal, sasaran akan bersendirian. Di blok kemudian, sasaran akan lebih sukar untuk dikesan kerana bunyi lain. Sentiasa mengabaikan bunyi yang lain, dan cuba melaporkan, ya atau tidak, sama ada bunyi sasaran hadir. Gunakan kekunci "Y" untuk ya dan kunci "n" untuk tidak.\n\nTekan kembali atau klik teruskan sebaik sahaja anda sudah bersedia. Butang teruskan akan hilang dengan serta -merta, dan eksperimen akan bermula sebaik sahaja bunyi dimuatkan, yang mengambil masa 40 saat atau lebih lama, bergantung kepada kelajuan sambungan internet. Kami berusaha untuk memendekkan kelewatan ini dalam pelepasan masa depan.\n\nMemuatkan bunyi ...',
